package org.apache.flume.sink.hive.utils;

import com.alibaba.fastjson.JSON;
import com.alibaba.fastjson.JSONObject;
import com.kritter.adserving.thrift.struct.AdStats;
import com.kritter.adserving.thrift.struct.AdservingRequestResponse;
import com.kritter.postimpression.thrift.struct.Billing;
import com.kritter.postimpression.thrift.struct.PostImpressionRequestResponse;
import org.junit.Ignore;
import org.junit.Test;

import java.util.Map;

@Ignore
public class DeserializeUtilsTest {
    @Test
    public void testAdservingSerializer() throws Exception {
        String adservingRequestResponse = "";
        String json = DeserializeUtils.deserializeToTBaseJson(adservingRequestResponse, AdservingRequestResponse.class.getName());
        System.out.println("adserving");
        System.out.println(json);
    }
    @Test
    public void testPostImpressionSerializer() throws Exception {
        String postImpressionRequestResponse = "";
        String json = DeserializeUtils.deserializeToTBaseJson(postImpressionRequestResponse, PostImpressionRequestResponse.class.getName());
        System.out.println("postimpression");
        System.out.println(json);
    }
    @Test
    public void testBillingSerializer() throws Exception {
        String billing = "";
        String json = DeserializeUtils.deserializeToTBaseJson(billing, Billing.class.getName());
        System.out.println("billing");
        System.out.println(json);
    }
    @Test
    public void testAdStatsSerializer() throws Exception {
        String adstats = "";
        String json = DeserializeUtils.deserializeToTBaseJson(adstats, AdStats.class.getName());
        JSONObject jsonObject = JSON.parseObject(json);
        Map totalRequestsMap = jsonObject.getObject("hourTotalRequestsMap", Map.class);
        System.out.println("totalRequestsMap:"+Long.valueOf(totalRequestsMap.keySet().toArray()[0].toString()));
        System.out.println("adstats");
        System.out.println(json);
    }
}